import React, { Component } from 'react';
import PageLogin from "./components/PageLogin"
import './App.css';
import Logo from "./components/Logo"

class App extends Component {

  render(){
    return (
        <span className="App">
          <Logo></Logo>
          <PageLogin></PageLogin>
        </span>
    );
  }


}

export default App;
